INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(1, 'The Shawshank Redemption', 1994, 'Frank Darabont', 9.3, 'Morgan Freeman as Ellis Boyd \'Red\' Redding\r\nTim Robbins as Andy Dufresne\r\nClancy Brown as Captain Hadley\r\nRita Hayworth as Gilda Mundson Farrell', 'Chronicles the experiences of a formerly successful banker as a prisoner in the gloomy jailhouse of Shawshank after being found guilty of a crime he did not commit. The film portrays the man\'s unique way of dealing with his new, torturous life; along the way he befriends a number of fellow prisoners, most notably a wise long-term inmate named Red.', 'Action / Crime / Drama', ),
(2, 'The Godfather', 1972, 'Francis Ford Coppola', 9.2, 'Marlon Brando as Don Vito Corleone\r\nAl Pacino as Michael Corleone\r\nTalia Shire as Connie\r\nDiane Keaton as Kay Adams', 'The Godfather \"Don\" Vito Corleone is the head of the Corleone mafia family in New York. He is at the event of his daughter\'s wedding. Michael, Vito\'s youngest son and a decorated WW II Marine is also present at the wedding. Michael seems to be uninterested in being a part of the family business. Vito is a powerful man, and is kind to all those who give him respect but is ruthless against those who do not. But when a powerful and treacherous rival wants to sell drugs and needs the Don\'s influence for the same, Vito refuses to do it. What follows is a clash between Vito\'s fading old values and the new ways which may cause Michael to do the thing he was most reluctant in doing and wage a mob war against all the other mafia families which could tear the Corleone family apart.', 'Action / Crime / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(3, 'The Mountain II', 2016, 'Alper Caglar', 9.2, '', 'DAG II; tells the story of a clandestine special forces squad; call sign \'Storm Bringer\'. Following the events of the first film, Bekir and Oguz, unlikely best friends, have enrolled in the world famous, perpetually grueling Turkish special forces training. Their first mission begins six years later-- to infiltrate the most barbarous area of modern day Iraq for a rescue mission.', 'Action / Drama / War', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(4, 'Natsamrat', 2016, 'Mahesh Manjrekar', 9.2, '', 'The film is a tragedy about a veteran theatre actor named Ganpat \"Appa\" Belwalkar (Nana Patekar) who has been the best of his lot during his heyday, garnering fame and fortune acting in plays based on various works, especially William Shakespeare\'s. It is a tragedy of a veteran actor who enjoyed a very vital importance in his life but who becomes the victim of old age alienation and estrangement. The film reveals an intensely tragic fate of an actor who becomes victim of fate and fortune in old age, which is similar to the fate of Lear. Natsamrat suffers the pangs of old age and dishonor inflicted on him by his own children. It is a tragedy of great humanist and actor who succumbs to the ill fate and destiny. In fact, Natsamrat is a story of Ganpatrao Belvalkar, who withstands great suffering after his retirement from stage acting.', 'Drama / Family', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(5, 'The Dark Knight', 2008, 'Christopher Nolan', 9, 'Christian Bale as Bruce Wayne\r\nCillian Murphy as Scarecrow\r\nHeath Ledger as Joker\r\nWilliam Fichtner as Bank Manager', 'Set within a year after the events of Batman Begins (2005), Batman, Lieutenant James Gordon, and new District Attorney Harvey Dent successfully begin to round up the criminals that plague Gotham City, until a mysterious and sadistic criminal mastermind known only as \"The Joker\" appears in Gotham, creating a new wave of chaos. Batman\'s struggle against The Joker becomes deeply personal, forcing him to \"confront everything he believes\" and improve his technology to stop him. A love triangle develops between Bruce Wayne, Dent, and Rachel Dawes.\r\n\r\n', 'Action / Adventure / Crime / Drama / Thriller', ),
(6, 'The Godfather: Part II', 1974, 'Francis Ford Coppola', 9, 'Robert De Niro as Vito Corleone\r\nAl Pacino as Michael\r\nTalia Shire as Connie Corleone\r\nDiane Keaton as Kay', 'The continuing saga of the Corleone crime family tells the story of a young Vito Corleone growing up in Sicily and in 1910s New York; and follows Michael Corleone in the 1950s as he attempts to expand the family business into Las Vegas, Hollywood and Cuba.\r\n\r\n', 'Action / Crime / Drama', ),
(7, 'Pulp Fiction\r\n', 1994, 'Quentin Tarantino', 8.9, 'Quentin Tarantino as Jimmie Dimmick\r\nBruce Willis as Butch Coolidge\r\nSamuel L. Jackson as Jules Winnfield\r\nJohn Travolta as Vincent Vega', 'Jules Winnfield (Samuel L. Jackson) and Vincent Vega (John Travolta) are two hit men who are out to retrieve a suitcase stolen from their employer, mob boss Marsellus Wallace (Ving Rhames). Wallace has also asked Vincent to take his wife Mia (Uma Thurman) out a few days later when Wallace himself will be out of town. Butch Coolidge (Bruce Willis) is an aging boxer who is paid by Wallace to lose his fight. The lives of these seemingly unrelated people are woven together comprising of a series of funny, bizarre and uncalled-for incidents.\r\n\r\n\r\n', 'Action / Crime / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(8, 'Schindler\'s List', 1993, 'Steven Spielberg', 8.9, 'Oskar Schindler is a vainglorious and greedy German businessman who becomes an unlikely humanitarian amid the barbaric German Nazi reign when he feels compelled to turn his factory into a refuge for Jews. Based on the true story of Oskar Schindler who managed to save about 1100 Jews from being gassed at the Auschwitz concentration camp, it is a testament to the good in all of us.', 'Oskar Schindler is a vainglorious and greedy German businessman who becomes an unlikely humanitarian amid the barbaric German Nazi reign when he feels compelled to turn his factory into a refuge for Jews. Based on the true story of Oskar Schindler who managed to save about 1100 Jews from being gassed at the Auschwitz concentration camp, it is a testament to the good in all of us.', 'Action / Biography / Drama / History', ),
(9, 'The Lord of the Rings: The Return of the King', 2003, 'Peter Jackson', 8.9, 'Marton Csokas as Celeborn\r\nCate Blanchett as Galadriel\r\nMiranda Otto as Eowyn\r\nSean Bean as Boromir', 'The final confrontation between the forces of good and evil fighting for control of the future of Middle-earth. Frodo and Sam reach Mordor in their quest to destroy the One Ring, while Aragorn leads the forces of good against Sauron\'s evil army at the stone city of Minas Tirith.', 'Action / Adventure / Drama / Fantasy', ),
(10, '12 Angry Men', 1957, 'Sidney Lumet', 8.9, 'Henry Fonda as Juror #8\r\nJack Warden as Juror #7\r\nJack Klugman as Juror #5\r\nE.G. Marshall as Juror #4', 'The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young man is guilty or innocent of murdering his father. What begins as an open-and-shut case of murder soon becomes a detective story that presents a succession of clues creating doubt, and a mini-drama of each of the jurors\' prejudices and preconceptions about the trial, the accused, and each other. Based on the play, all of the action takes place on the stage of the jury room.\r\n\r\n', 'Action / Crime / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(11, 'Fight Club', 1999, 'David Fincher', 8.8, 'Brad Pitt as Tyler Durden\r\nJared Leto as Angel Face\r\nHelena Bonham Carter as Marla Singer\r\nEdward Norton as The Narrator', 'A nameless first person narrator (Edward Norton) attends support groups in attempt to subdue his emotional state and relieve his insomniac state. When he meets Marla (Helena Bonham Carter), another fake attendee of support groups, his life seems to become a little more bearable. However when he associates himself with Tyler (Brad Pitt) he is dragged into an underground fight club and soap making scheme. Together the two men spiral out of control and engage in competitive rivalry for love and power. When the narrator is exposed to the hidden agenda of Tyler\'s fight club, he must accept the awful truth that Tyler may not be who he says he is.', 'Action / Drama', ),
(12, 'Forrest Gump\r\n', 1994, 'Robert Zemeckis', 8.8, 'Tom Hanks as Forrest Gump\r\nRobin Wright as Jenny Curran\r\nKurt Russell as Elvis Presley\r\nHaley Joel Osment as Forrest Junior', 'Forrest Gump is a simple man with a low I.Q. but good intentions. He is running through childhood with his best and only friend Jenny. His \'mama\' teaches him the ways of life and leaves him to choose his destiny. Forrest joins the army for service in Vietnam, finding new friends called Dan and Bubba, he wins medals, creates a famous shrimp fishing fleet, inspires people to jog, starts a ping-pong craze, creates the smiley, writes bumper stickers and songs, donates to people and meets the president several times. However, this is all irrelevant to Forrest who can only think of his childhood sweetheart Jenny Curran, who has messed up her life. Although in the end all he wants to prove is that anyone can love anyone.', 'Action / Comedy / Drama / Romance', ),
(13, 'Inception', 2010, 'Christopher Nolan', 8.8, 'Tom Hardy as Eames\r\nLeonardo DiCaprio as Cobb\r\nJoseph Gordon-Levitt as Arthur\r\nCillian Murphy as Robert Fischer', 'Dom Cobb is a skilled thief, the absolute best in the dangerous art of extraction, stealing valuable secrets from deep within the subconscious during the dream state, when the mind is at its most vulnerable. Cobb\'s rare ability has made him a coveted player in this treacherous new world of corporate espionage, but it has also made him an international fugitive and cost him everything he has ever loved. Now Cobb is being offered a chance at redemption. One last job could give him his life back but only if he can accomplish the impossible, inception. Instead of the perfect heist, Cobb and his team of specialists have to pull off the reverse: their task is not to steal an idea, but to plant one. If they succeed, it could be the perfect crime. But no amount of careful planning or expertise can prepare the team for the dangerous enemy that seems to predict their every move. An enemy that only Cobb could have seen coming.', 'Action / Adventure / Crime / Mystery / Sci-Fi / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(14, 'The Phantom of the Opera at the Royal Albert Hall', 2011, 'Nick Morris', 8.8, 'Michael Crawford as The Phantom - Original Company\r\nRamin Karimloo as The Phantom\r\nHadley Fraser as Raoul', 'In 1986, Andrew Lloyd Webber\'s The Phantom of the Opera arrived on the West End stage at Her Majesty\'s Theatre. Fast forward 25 years and Phantom has achieved global success, millions of viewers, a film adaptation in 2004 and a musical sequel. Now viewers have the chance to experience this phenomenal show right from their own screens. Filmed at the Royal Albert Hall, this stunning performance brings the show to a bigger stage and celebrates its role as one of the biggest shows in theatre history, with speeches, performances and appearances by the original cast and some of the show\'s most notable Phantoms, including John Owen-Jones and Colm Wilkinson. Starring Ramin Karimloo and Sierra Boggess, Phantom tells the story of a deformed musical genius who lives in the catacombs of the Paris Opera House. Shunned by society, the Phantom seeks revenge in cruel and often violent acts. The Phantom is in love with chorus girl Christine Daaé and has been secretly training her to replace La ...', 'Drama / Music / Musical / Romance / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(15, 'The Good, the Bad and the Ugly', 1966, 'Sergio Leone', 8.8, 'Clint Eastwood as Blondie\r\nEli Wallach as Tuco\r\nLee Van Cleef as Sentenza / Angel Eyes\r\nMario Brega as Cpl. Wallace', 'Blondie (The Good) is a professional gunslinger who is out trying to earn a few dollars. Angel Eyes (The Bad) is a hit man who always commits to a task and sees it through, as long as he is paid to do so. And Tuco (The Ugly) is a wanted outlaw trying to take care of his own hide. Tuco and Blondie share a partnership together making money off Tuco\'s bounty, but when Blondie unties the partnership, Tuco tries to hunt down Blondie. When Blondie and Tuco come across a horse carriage loaded with dead bodies, they soon learn from the only survivor (Bill Carson) that he and a few other men have buried a stash of gold in a cemetery. Unfortunately Carson dies and Tuco only finds out the name of the cemetery, while Blondie finds out the name on the grave. Now the two must keep each other alive in order to find the gold. Angel Eyes (who had been looking for Bill Carson) discovers that Tuco and Blondie met with Carson and knows they know the location of the gold. All he needs is for the two to ...', 'Action / Western', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(16, 'The Lord of the Rings: The Fellowship of the Ring', 2001, 'Peter Jackson', 8.8, 'Marton Csokas as Celeborn\r\nCate Blanchett as Galadriel\r\nSean Bean as Boromir\r\nAndy Serkis as Gollum', 'An ancient Ring thought lost for centuries has been found, and through a strange twist of fate has been given to a small Hobbit named Frodo. When Gandalf discovers the Ring is in fact the One Ring of the Dark Lord Sauron, Frodo must make an epic quest to the Cracks of Doom in order to destroy it. However, he does not go alone. He is joined by Gandalf, Legolas the elf, Gimli the Dwarf, Aragorn, Boromir, and his three Hobbit friends Merry, Pippin, and Samwise. Through mountains, snow, darkness, forests, rivers and plains, facing evil and danger at every corner the Fellowship of the Ring must go. Their quest to destroy the One Ring is the only hope for the end of the Dark Lords reign.', 'Action / Adventure / Drama / Fantasy', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(17, 'Anand', 1971, 'Hrishikesh Mukherjee', 8.8, 'Amitabh Bachchan as Dr. Bhaskar K. Bannerjee / Babu Moshai', 'Dr Bhaskar Bannerjee is not happy with his profession as he cant save the lives of people dying of illness due to poverty.His Dr friend Kulkarni charges huge for imaginary illness of rich and uses that money to people who cant afford treatment.Things change when Anand a cancer patients enters Bhaskar\'s life Anand is cheerful and believes in spreading happiness to everyone as he knows he is on last stage of cancer and has few months to live.Bhaskar and Anand bond very well Anand also gets Bhaskar\'s love life back on track and Bhaskar doesn\'t want him to loose anymore.As time passes Anand\'s condition starts to deteriorate and everyone around him is just hoping for a miracle.', 'Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(18, 'Goodfellas', 1990, 'Martin Scorsese', 8.7, 'Robert De Niro as James Conway\r\nSamuel L. Jackson as Stacks Edwards\r\nJoe Pesci as Tommy DeVito\r\nRay Liotta as Henry Hill', 'Henry Hill might be a small time gangster, who may have taken part in a robbery with Jimmy Conway and Tommy De Vito, two other gangsters who might have set their sights a bit higher. His two partners could kill off everyone else involved in the robbery, and slowly start to think about climbing up through the hierarchy of the Mob. Henry, however, might be badly affected by his partners\' success, but will he consider stooping low enough to bring about the downfall of Jimmy and Tommy?\r\n\r\n', 'Action / Biography / Crime / Drama', ),
(19, 'One Flew Over the Cuckoo\'s Nest', 1975, 'Milos Forman', 8.7, 'Jack Nicholson as R.P. McMurphy\r\nDanny DeVito as Martini\r\nChristopher Lloyd as Taber\r\nBrad Dourif as Billy Bibbit', 'McMurphy has a criminal past and has once again gotten himself into trouble and is sentenced by the court. To escape labor duties in prison, McMurphy pleads insanity and is sent to a ward for the mentally unstable. Once here, McMurphy both endures and stands witness to the abuse and degradation of the oppressive Nurse Ratched, who gains superiority and power through the flaws of the other inmates. McMurphy and the other inmates band together to make a rebellious stance against the atrocious Nurse.', 'Action / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(20, 'Star Wars: Episode V - The Empire Strikes Back', 1980, 'Irvin Kershner', 8.7, 'Carrie Fisher as Princess Leia\r\nMark Hamill as Luke Skywalker\r\nHarrison Ford as Han Solo\r\nPeter Mayhew as Chewbacca', 'Luke Skywalker, Han Solo, Princess Leia and Chewbacca face attack by the Imperial forces and its AT-AT walkers on the ice planet Hoth. While Han and Leia escape in the Millennium Falcon, Luke travels to Dagobah in search of Yoda. Only with the Jedi Master\'s help will Luke survive when the Dark Side of the Force beckons him into the ultimate duel with Darth Vader.', 'Action / Adventure / Fantasy / Sci-Fi', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(21, 'Queen Rock Montreal & Live Aid', 2007, 'Saul Swimmer', 8.7, '', 'The movie contains two concerts of the British rock band Queen. The first concert is their show at Montreal in November 1981. The second concert is their live performance at Live Aid in 1985.', 'Action / Documentary / Music', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(22, 'The Lord of the Rings: The Two Towers', 2002, 'Peter Jackson', 8.7, 'Cate Blanchett as Galadriel\r\nMiranda Otto as Eowyn\r\nSean Bean as Boromir\r\nAndy Serkis as Gollum', 'The continuing quest of Frodo and the Fellowship to destroy the One Ring. Frodo and Sam discover they are being followed by the mysterious Gollum. Aragorn, the Elf archer Legolas, and Gimli the Dwarf encounter the besieged Rohan kingdom, whose once great King Theoden has fallen under Saruman\'s deadly spell.', 'Action / Adventure / Drama / Family / Fantasy', ),
(23, 'The Matrix', 1999, 'Andy Wachowski', 8.7, 'Carrie-Anne Moss as Trinity\r\nKeanu Reeves as Neo\r\nHugo Weaving as Agent Smith\r\nLaurence Fishburne as Morpheus', 'Thomas A. Anderson is a man living two lives. By day he is an average computer programmer and by night a hacker known as Neo. Neo has always questioned his reality, but the truth is far beyond his imagination. Neo finds himself targeted by the police when he is contacted by Morpheus, a legendary computer hacker branded a terrorist by the government. Morpheus awakens Neo to the real world, a ravaged wasteland where most of humanity have been captured by a race of machines that live off of the humans\' body heat and electrochemical energy and who imprison their minds within an artificial reality known as the Matrix. As a rebel against the machines, Neo must return to the Matrix and confront the agents: super-powerful computer programs devoted to snuffing out Neo and the entire human rebellion.', 'Action / Sci-Fi', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(24, 'Seven Samurai', 1954, 'Akira Kurosawa', 8.7, 'Toshirô Mifune as Kikuchiyo\r\nTatsuya Nakadai as Samurai Wandering Through Town\r\nTakashi Shimura as Kambei Shimada', 'A veteran samurai, who has fallen on hard times, answers a village\'s request for protection from bandits. He gathers 6 other samurai to help him, and they teach the townspeople how to defend themselves, and they supply the samurai with three small meals a day. The film culminates in a giant battle when 40 bandits attack the village.', 'Action / Adventure / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(25, 'Be Here Now\r\n', 2015, 'Lilibet Foster', 8.7, 'Jai Courtney', 'As though life is imitating art, actor and sex-symbol, Andy Whitfield, had just become a star as the lead in the hit television series,\'Spartacus,\' when he is faced with his biggest personal challenge - life-threatening cancer. \'Be Here Now\' is a feature documentary that follows him on his dramatic journey to cure himself. Confirmed in matching affirmative tattoos, he and his charismatic wife and their two children, commit to taking Andy\'s healing into their own hands and living life fully, not in the shadows of the disease. Each step tests their limits and strength of character, while revealing their tenderness, humor and determination. And, as each person goes through their own transformations, the film becomes an inspiring and universal story of courage, love and resilience.\r\n', 'Biography / Documentary / Drama / Family', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(26, 'Human', 2015, 'Yann Arthus-Bertrand', 8.7, '', 'A collection of stories about and images of our world, offering an immersion to the core of what it means to be human.', 'Documentary', ),
(27, 'Interstellar', 2014, 'Christopher Nolan', 8.6, 'Jessica Chastain as Murph\r\nMatthew McConaughey as Cooper\r\nAnne Hathaway as Brand\r\nMatt Damon as Mann', 'Earth\'s future has been riddled by disasters, famines, and droughts. There is only one way to ensure mankind\'s survival: Interstellar travel. A newly discovered wormhole in the far reaches of our solar system allows a team of astronauts to go where no man has gone before, a planet that may have the right environment to sustain human life.', 'Action / Adventure / Drama / Sci-Fi', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(28, 'It\'s a Wonderful Life', 1946, 'Frank Capra', 8.6, 'James Stewart as George Bailey\r\nDonna Reed as Mary Hatch\r\nGloria Grahame as Violet\r\nThomas Mitchell as Uncle Billy', 'George Bailey has spent his entire life giving of himself to the people of Bedford Falls. He has always longed to travel but never had the opportunity in order to prevent rich skinflint Mr. Potter from taking over the entire town. All that prevents him from doing so is George\'s modest building and loan company, which was founded by his generous father. But on Christmas Eve, George\'s Uncle Billy loses the business\'s $8,000 while intending to deposit it in the bank. Potter finds the misplaced money and hides it from Billy. When the bank examiner discovers the shortage later that night, George realizes that he will be held responsible and sent to jail and the company will collapse, finally allowing Potter to take over the town. Thinking of his wife, their young children, and others he loves will be better off with him dead, he contemplates suicide. But the prayers of his loved ones result in a gentle angel named Clarence coming to earth to help George, with the promise of earning his ...', 'Action / Drama / Family / Fantasy / Romance', ),
(29, 'Léon: The Professional', 1994, 'Luc Besson', 8.6, 'Natalie Portman as Mathilda\r\nGary Oldman as Stansfield\r\nJean Reno as Léon\r\nMaïwenn as Blond Babe', 'After her father, mother, older sister and little brother are killed by her father\'s employers, the 12-year-old daughter of an abject drug dealer is forced to take refuge in the apartment of a professional hitman who at her request teaches her the methods of his job so she can take her revenge on the corrupt DEA agent who ruined her life by killing her beloved brother.', 'Action / Crime / Drama / Thriller', ),
(30, 'Life Is Beautiful\r\n', 1997, 'Roberto Benigni', 8.6, 'Roberto Benigni as Guido\r\nRichard Sammel as Ufficiale stanzioncina\r\nHorst Buchholz as Dottor Lessing\r\nGiorgio Cantarini as Giosué', 'In 1930s Italy, a carefree Jewish book keeper named Guido starts a fairy tale life by courting and marrying a lovely woman from a nearby city. Guido and his wife have a son and live happily together until the occupation of Italy by German forces. In an attempt to hold his family together and help his son survive the horrors of a Jewish Concentration Camp, Guido imagines that the Holocaust is a game and that the grand prize for winning is a tank.', 'Comedy / Drama / Romance / War', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(31, 'Saving Private Ryan', 1998, 'Steven Spielberg', 8.6, 'Tom Hanks as Captain Miller\r\nMatt Damon as Private Ryan\r\nRyan Hurst as Paratrooper Mandelsohn\r\nVin Diesel as Private Caparzo', 'Opening with the Allied invasion of Normandy on 6 June 1944, members of the 2nd Ranger Battalion under Cpt. Miller fight ashore to secure a beachhead. Amidst the fighting, two brothers are killed in action. Earlier in New Guinea, a third brother is KIA. Their mother, Mrs. Ryan, is to receive all three of the grave telegrams on the same day. The United States Army Chief of Staff, George C. Marshall, is given an opportunity to alleviate some of her grief when he learns of a fourth brother, Private James Ryan, and decides to send out 8 men (Cpt. Miller and select members from 2nd Rangers) to find him and bring him back home to his mother...', 'Action / Drama / War', ),
(32, 'Se7en', 1995, 'David Fincher', 8.6, 'Brad Pitt as Mills\r\nMorgan Freeman as Somerset\r\nKevin Spacey as John Doe\r\nGwyneth Paltrow as Tracy', 'A film about two homicide detectives\' (Morgan Freeman and Brad Pitt) desperate hunt for a serial killer who justifies his crimes as absolution for the world\'s ignorance of the Seven Deadly Sins. The movie takes us from the tortured remains of one victim to the next as the sociopathic \"John Doe\" (Kevin Spacey) sermonizes to Detectives Somerset and Mills -- one sin at a time. The sin of Gluttony comes first and the murderer\'s terrible capacity is graphically demonstrated in the dark and subdued tones characteristic of film noir. The seasoned and cultured but jaded Somerset researches the Seven Deadly Sins in an effort to understand the killer\'s modus operandi while the bright but green and impulsive Detective Mills (Pitt) scoffs at his efforts to get inside the mind of a killer...', 'Action / Crime / Drama / Mystery / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(33, 'Star Wars: Episode IV - A New Hope', 1977, 'George Lucas', 8.6, 'Carrie Fisher as Princess Leia Organa\r\nMark Hamill as Luke Skywalker\r\nHarrison Ford as Han Solo\r\nPeter Mayhew as Chewbacca', 'The Imperial Forces, under orders from cruel Darth Vader, hold Princess Leia hostage in their efforts to quell the rebellion against the Galactic Empire. Luke Skywalker and Han Solo, captain of the Millennium Falcon, work together with the companionable droid duo R2-D2 and C-3PO to rescue the beautiful princess, help the Rebel Alliance and restore freedom and justice to the Galaxy.', 'Action / Adventure / Fantasy / Sci-Fi', ),
(34, 'The Green Mile', 1999, 'Frank Darabont', 8.6, 'Tom Hanks as Paul Edgecomb\r\nSam Rockwell as \'Wild Bill\' Wharton\r\nMichael Clarke Duncan as John Coffey\r\nPatricia Clarkson as Melinda Moores', 'Death Row guards at a penitentiary, in the 1930\'s, have a moral dilemma with their job when they discover one of their prisoners, a convicted murderer, has a special gift.', 'Action / Crime / Drama / Fantasy / Mystery', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(35, 'The Silence of the Lambs', 1991, 'Jonathan Demme', 8.6, 'Jodie Foster as Clarice Starling\r\nAnthony Hopkins as Dr. Hannibal Lecter\r\nScott Glenn as Jack Crawford\r\nTed Levine as Jame Gumb', 'F.B.I. trainee Clarice Starling (Jodie Foster) works hard to advance her career, while trying to hide or put behind her West Virginia roots, of which if some knew, would automatically classify her as being backward or white trash. After graduation, she aspires to work in the agency\'s Behavioral Science Unit under the leadership of Jack Crawford (Scott Glenn). While she is still a trainee, Crawford asks her to question Dr. Hannibal Lecter (Sir Anthony Hopkins), a psychiatrist imprisoned, thus far, for eight years in maximum security isolation for being a serial killer who cannibalized his victims. Clarice is able to figure out the assignment is to pick Lecter\'s brains to help them solve another serial murder case, that of someone coined by the media as \"Buffalo Bill\" (Ted Levine), who has so far killed five victims, all located in the eastern U.S., all young women, who are slightly overweight (especially around the hips), all who were drowned in natural bodies of water, and all who ...', 'Action / Crime / Drama / Horror / Mystery / Thriller', ),
(36, 'The Usual Suspects', 1995, 'Bryan Singer', 8.6, 'Kevin Spacey as Verbal\r\nBenicio Del Toro as Fenster\r\nGiancarlo Esposito as Jack Baer\r\nClark Gregg as Dr. Walters', 'Following a truck hijack in New York, five criminals are arrested and brought together for questioning. As none of them are guilty, they plan a revenge operation against the police. The operation goes well, but then the influence of a legendary mastermind criminal called Keyser Söze is felt. It becomes clear that each one of them has wronged Söze at some point and must pay back now. The payback job leaves 27 men dead in a boat explosion, but the real question arises now: Who actually is Keyser Söze?', 'Action / Crime / Drama / Mystery / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(37, 'Porcupine Tree: Anesthetize', 2010, 'Lasse Hoile', 8.6, '', 'Anesthetize is the second live DVD by progressive rock band Porcupine Tree, released on 20 May 2010. The Blu-ray edition was released on 15 June.', 'Action / Documentary / Music', ),
(38, 'Spirited Away', 2001, 'Kirk Wise', 8.6, 'Lauren Holly as Chihiro\'s Mother\r\nJohn Ratzenberger as Assistant Manager\r\nMichael Chiklis as Chihiro\'s Father\r\nDaveigh Chase as Chihiro', 'Chihiro and her parents are moving to a small Japanese town in the countryside, much to Chihiro\'s dismay. On the way to their new home, Chihiro\'s father makes a wrong turn and drives down a lonely one-lane road which dead-ends in front of a tunnel. Her parents decide to stop the car and explore the area. They go through the tunnel and find an abandoned amusement park on the other side, with its own little town. When her parents see a restaurant with great-smelling food but no staff, they decide to eat and pay later. However, Chihiro refuses to eat and decides to explore the theme park a bit more. She meets a boy named Haku who tells her that Chihiro and her parents are in danger, and they must leave immediately. She runs to the restaurant and finds that her parents have turned into pigs. In addition, the theme park turns out to be a town inhabited by demons, spirits, and evil gods. At the center of the town is a bathhouse where these creatures go to relax. The owner of the bathhouse ...', 'Adventure / Animation / Family / Fantasy / Mystery', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(39, 'City of God', 2002, 'Fernando Meirelles', 8.6, 'Alice Braga as Angélica\r\nSeu Jorge as Mané Galinha - Knockout Ned', 'Brazil, 1960s, City of God. The Tender Trio robs motels and gas trucks. Younger kids watch and learn well...too well. 1970s: Li\'l Zé has prospered very well and owns the city. He causes violence and fear as he wipes out rival gangs without mercy. His best friend Bené is the only one to keep him on the good side of sanity. Rocket has watched these two gain power for years, and he wants no part of it. Yet he keeps getting swept up in the madness. All he wants to do is take pictures. 1980s: Things are out of control between the last two remaining gangs...will it ever end? Welcome to the City of God.', 'Crime / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(40, 'Scenes from a Marriage', 1974, 'Ingmar Bergman', 8.6, 'Bibi Andersson as Katarina', 'Scenes From a Marriage, is by far, Bergman\'s greatest creation. Following 2 characters, Marianne and Johan, the film, in typical Bergman exquisite style, examines ontological questions of love, loneliness, being and what it means to be \'fulfilled\'. As with all of Betgman\'s films, \'Scenes From a Marriage\', is not simply a narrative about a married couple and their \'ups and downs\'. Bergman, successfully probes into what it means and feels like to need the love and/or security, validation of another person and the consequences of life-changing decisions. It is a must-see, from the greatest film maker there has ever been.\r\n\r\n', 'Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(41, 'Uri: The Surgical Strike', 2019, 'Aditya Dhar', 8.6, 'Vicky Kaushal\r\nYami Gautam', 'Divided over five chapters, the film chronicles the events of the surgical strike conducted by the Indian military against suspected militants in Pakistan occupied Kashmir. It tells the story of the 11 tumultuous events over which the operation was carried out. Indian army special forces carry out a covert operation to avenge the killing of fellow army men at their base by a terrorist group.', 'Action / Drama / War', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(42, 'Baraka', 1992, 'Ron Fricke', 8.6, '', 'Without words, cameras show us the world, with an emphasis not on \"where,\" but on \"what\'s there.\" It begins with morning, natural landscapes and people at prayer: volcanoes, water falls, veldts, and forests; several hundred Balinese Hindu men perform kecak, the monkey chant. Indigenous peoples apply body paint; whole villages dance. The film moves to destruction of nature via logging, blasting, and strip mining. Images of poverty, rapid urban life, and factories give way to war, concentration camps, and mass graves. Ancient ruins come into view, and then a sacred river where pilgrims bathe and funeral pyres burn. Prayer and nature return. A monk rings a huge bell; stars wheel across the sky.', 'Documentary', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(43, 'Nature Owl Power', 2015, 'Lucy Smith', 8.6, '', 'For centuries, the mysterious nighttime lives and uncanny hunting skills of owls have made them fascinating hallmarks of children\'s stories and folk tales the world over. But what actually makes owls so special? Bird trainers Lloyd and Rose Buck and their very special family of owls, eagles, falcons, geese, pigeons, and two newly-hatched barn owls - Luna and Lily - provide a rare opportunity to learn more about these unique birds. Using the latest in camera technology, computer graphics, x-rays and super-sensitive microphones, we can take a brand new look at owls in more detail than ever before. The real stories behind how they hunt, how their vision and hearing works, and how they fly so silently are influencing 21st century technology and design.', 'Documentary / Family', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(44, 'Alien', 1979, 'Ridley Scott', 8.5, 'Sigourney Weaver as Ripley\r\nJohn Hurt as Kane\r\nTom Skerritt as Dallas\r\nHarry Dean Stanton as Brett', 'In the distant future, the crew of the commercial spaceship Nostromo are on their way home when they pick up a distress call from a distant moon. The crew are under obligation to investigate and the spaceship descends on the moon afterwards. After a rough landing, three crew members leave the spaceship to explore the area on the moon. At the same time as they discover a hive colony of some unknown creature, the ship\'s computer deciphers the message to be a warning, not a distress call. When one of the eggs is disturbed, the crew realizes that they are not alone on the spaceship and they must deal with the consequences.', 'Action / Horror / Sci-Fi', ),
(45, 'American History X\r\n', 1998, 'Tony Kaye', 8.5, 'Edward Norton as Derek Vinyard\r\nBeverly D\'Angelo as Doris Vinyard\r\nFairuza Balk as Stacey\r\nEthan Suplee as Seth Ryan', 'Derek Vineyard is paroled after serving 3 years in prison for brutally killing two black men who tried to break into/steal his truck. Through his brother\'s, Danny Vineyard, narration, we learn that before going to prison, Derek was a skinhead and the leader of a violent white supremacist gang that committed acts of racial crime throughout L.A. and his actions greatly influenced Danny. Reformed and fresh out of prison, Derek severs contact with the gang and becomes determined to keep Danny from going down the same violent path as he did.', 'Action / Crime / Drama', ),
(46, 'Back to the Future', 1985, 'Robert Zemeckis', 8.5, 'Lea Thompson as Lorraine Baines\r\nMichael J. Fox as Marty McFly\r\nCrispin Glover as George McFly\r\nChristopher Lloyd as Dr. Emmett Brown', 'Marty McFly, a typical American teenager of the Eighties, is accidentally sent back to 1955 in a plutonium-powered DeLorean \"time machine\" invented by a slightly mad scientist. During his often hysterical, always amazing trip back in time, Marty must make certain his teenage parents-to-be meet and fall in love - so he can get back to the future.', 'Action / Adventure / Comedy / Sci-Fi', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(47, 'Casablanca', 1942, 'Michael Curtiz', 8.5, 'Ingrid Bergman as Ilsa Lund\r\nHumphrey Bogart as Rick Blaine\r\nPeter Lorre as Ugarte\r\nClaude Rains as Captain Louis Renault', 'The story of Rick Blaine, a cynical world-weary ex-patriate who runs a nightclub in Casablanca, Morocco during the early stages of WWII. Despite the pressure he constantly receives from the local authorities, Rick\'s cafe has become a kind of haven for refugees seeking to obtain illicit letters that will help them escape to America. But when Ilsa, a former lover of Rick\'s, and her husband, show up to his cafe one day, Rick faces a tough challenge which will bring up unforeseen complications, heartbreak and ultimately an excruciating decision to make.', 'Action / Drama / Romance / War', ),
(48, 'City Lights', 1931, 'Charles Chaplin', 8.5, 'Charles Chaplin as A Tramp\r\nJean Harlow as Diner in Restaurant Scene\r\nBuster Brodie as Bald Party Guest', 'A tramp falls in love with a beautiful blind girl. Her family is in financial trouble. The tramp\'s on-and-off friendship with a wealthy man allows him to be the girl\'s benefactor and suitor.', 'Action / Comedy / Drama / Romance', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(49, 'Gladiator', 2000, 'Ridley Scott', 8.5, 'Tommy Flanagan as Cicero\r\nJoaquin Phoenix as Commodus\r\nRussell Crowe as Maximus\r\nRichard Harris as Marcus Aurelius', 'Maximus is a powerful Roman general, loved by the people and the aging Emperor, Marcus Aurelius. Before his death, the Emperor chooses Maximus to be his heir over his own son, Commodus, and a power struggle leaves Maximus and his family condemned to death. The powerful general is unable to save his family, and his loss of will allows him to get captured and put into the Gladiator games until he dies. The only desire that fuels him now is the chance to rise to the top so that he will be able to look into the eyes of the man who will feel his revenge.\r\n\r\n', 'Action / Adventure / Drama / Romance', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(50, 'Memento', 2000, 'Christopher Nolan', 8.5, 'Carrie-Anne Moss as Natalie\r\nGuy Pearce as Leonard\r\nThomas Lennon as Doctor\r\nJoe Pantoliano Picture	Joe Pantoliano as Teddy', 'Memento chronicles two separate stories of Leonard, an ex-insurance investigator who can no longer build new memories, as he attempts to find the murderer of his wife, which is the last thing he remembers. One story line moves forward in time while the other tells the story backwards revealing more each time.', 'Action / Mystery / Thriller', ),
(51, 'Modern Times\r\n', 1936, 'Charles Chaplin', 8.5, 'Charles Chaplin as A Factory Worker\r\nPaulette Goddard as A Gamin\r\nGloria DeHaven as Gamin\'s Sister', 'Chaplin\'s last \'silent\' film, filled with sound effects, was made when everyone else was making talkies. Charlie turns against modern society, the machine age, (The use of sound in films ?) and progress. Firstly we see him frantically trying to keep up with a production line, tightening bolts. He is selected for an experiment with an automatic feeding machine, but various mishaps leads his boss to believe he has gone mad, and Charlie is sent to a mental hospital - When he gets out, he is mistaken for a communist while waving a red flag, sent to jail, foils a jailbreak, and is let out again. We follow Charlie through many more escapades before the film is out.', 'Action / Comedy / Drama / Family / Romance / Sci-Fi', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(52, 'Once Upon a Time in the West\r\n', 1968, 'Sergio Leone', 8.5, 'Claudia Cardinale as Jill McBain\r\nCharles Bronson as Harmonica\r\nKeenan Wynn as Sheriff - Auctioneer\r\nHenry Fonda as Frank', 'Story of a young woman, Mrs. McBain, who moves from New Orleans to frontier Utah, on the very edge of the American West. She arrives to find her new husband and family slaughtered, but by whom? The prime suspect, coffee-lover Cheyenne, befriends her and offers to go after the real killer, assassin gang leader Frank, in her honor. He is accompanied by Harmonica, a man already on a quest to get even.', 'Action / History / Romance / Western', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(53, 'Champion\r\n', 2018, 'Ahmet Katiksiz', 8.5, '', 'The champion is a great love story between Halis Karatas and Begum Atman, who came together with the legendary race horse Bold Pilot. Adapted from a true story, the film is owned by the prominent name of Turkish horseshoe Ozdemir Atman and the Bold Pilot is a horse that won the love of even those not interested in horse racing. Bold Pilot and his permanent jockey Halis Karatas together achieved unforgettable successes. The 2: 26: 22 record in the 1996 Gazi Race did not pass yet. Another success of the Bold Pilot is the presence of Halis Karatas and Begum Atman. Ahmet Katyksiz is sitting in the director\'s chair of the film, where he is the epic topic of love between the famous jockey and Begum Atman. Serkan Yoruk wrote the screenplay to the famous jockey Halis Karatas\'a Ekin Koc, while Begum Atman Farah Zeynep Abdullah gives life. The Jockey Club of Turkey Ozdemir Atman, the former president, played by veteran actor Fikret Kuskan. (Translation from CJ Entertainment Turkey).', 'Drama / Romance / Sport', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(54, 'Psycho', 1960, 'Alfred Hitchcock', 8.5, 'Janet Leigh as Marion Crane\r\nAlfred Hitchcock as Man Outside Real Estate Office\r\nAnthony Perkins as Norman Bates\r\nVera Miles as Lila Crane', 'Phoenix office worker Marion Crane is fed up with the way life has treated her. She has to meet her lover Sam in lunch breaks, and they cannot get married because Sam has to give most of his money away in alimony. One Friday, Marion is trusted to bank forty thousand dollars by her employer. Seeing the opportunity to take the money and start a new life, Marion leaves town and heads towards Sam\'s California store. Tired after the long drive and caught in a storm, she gets off the main highway and pulls into the Bates Motel. The motel is managed by a quiet young man called Norman who seems to be dominated by his mother.\r\n\r\n', 'Action / Horror / Mystery / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(55, 'Raiders of the Lost Ark', 1981, 'Steven Spielberg', 8.5, 'Harrison Ford as Indy\r\nJohn Rhys-Davies as Sallah\r\nAlfred Molina as Satipo\r\nKaren Allen as Marion Ravenwood', 'The year is 1936. An archeology professor named Indiana Jones is venturing in the jungles of South America searching for a golden statue. Unfortunately, he sets off a deadly trap but miraculously escapes. Then, Jones hears from a museum curator named Marcus Brody about a biblical artifact called The Ark of the Covenant, which can hold the key to humanly existence. Jones has to venture to vast places such as Nepal and Egypt to find this artifact. However, he will have to fight his enemy Rene Belloq and a band of Nazis in order to reach it.', 'Action / Adventure', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(56, 'Terminator 2: Judgment Day', 1991, 'James Cameron', 8.5, 'Arnold Schwarzenegger as The Terminator\r\nLinda Hamilton as Sarah Connor\r\nRobert Patrick as T-1000\r\nJames Cameron as Cowardly Biker who drops pool stick', 'Over 10 years have passed since the first robot called The Terminator tried to kill Sarah Connor and her unborn son, John. The man who will become the future leader of the human resistance against the Machines is now a healthy young boy. However, another Terminator, called the T-1000, is sent back through time by the supercomputer Skynet. This new Terminator is more advanced and more powerful than its predecessor and its mission is to kill John Connor when he\'s still a child. However, Sarah and John do not have to face the threat of the T-1000 alone. Another Terminator (identical to the same model that tried and failed to kill Sarah Conner in 1984) is also sent back through time. This Terminator has been reprogrammed by the future Resistance on the orders of adult John. This Terminator\'s mission is to protect John and Sarah Connor at all costs. The battle for tomorrow has begun.', 'Action / Adventure / Sci-Fi / Thriller', ),
(57, 'The Departed\r\n', 2006, 'Martin Scorsese', 8.5, 'Leonardo DiCaprio as Billy\r\nMatt Damon as Colin Sullivan\r\nMark Wahlberg as Dignam\r\nVera Farmiga as Madolyn', 'In South Boston, the state police force is waging war on Irish-American organized crime. Young undercover cop Billy Costigan is assigned to infiltrate the mob syndicate run by gangland chief Frank Costello. While Billy quickly gains Costello\'s confidence, Colin Sullivan, a hardened young criminal who has infiltrated the state police as an informer for the syndicate is rising to a position of power in the Special Investigation Unit. Each man becomes deeply consumed by their double lives, gathering information about the plans and counter-plans of the operations they have penetrated. But when it becomes clear to both the mob and the police that there is a mole in their midst, Billy and Colin are suddenly in danger of being caught and exposed to the enemy - and each must race to uncover the identity of the other man in time to save themselves. But is either willing to turn on their friends and comrades they\'ve made during their long stints undercover?\r\n\r\n', 'Action / Crime / Drama / Thriller', ),
(58, 'The Great Dictator', 1940, 'Charles Chaplin', 8.5, 'Charles Chaplin', '20 years after the end of WWI, in which the nation of Tomainia was on the losing side, Adenoid Hynkel has risen to power as the ruthless dictator of the country. He believes in a pure Aryan state and the decimation of the Jews. This situation is unknown to a simple Jewish Tomainian barber who has been hospitalized since a WWI battle. Upon his release the barber, who had been suffering from memory loss about the war, is shown the new persecuted life of the Jews by many living in the Jewish ghetto, including a washerwoman named Hannah with whom he begins a relationship. The barber is ultimately spared such persecution by Commander Schultz, whom he saved in that WWI battle. The lives of all Jews in Tomainia are eventually spared with a policy shift by Hynkel himself, who is doing so for ulterior motives. But those motives include a desire for world domination, starting with the invasion of neighboring Osterlich, which may be threatened by Benzino Napaloni, the dictator of neighboring ...', 'Action / Comedy / Drama / War', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(59, 'The Lion King', 1994, 'Rob Minkoff', 8.5, 'Jonathan Taylor Thomas as Young Simba\r\nJames Earl Jones as Mufasa\r\nJeremy Irons as Scar\r\nMatthew Broderick as Adult Simba', 'A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?', 'Action / Adventure / Animation / Drama / Family / Musical', ),
(60, 'The Pianist', 2002, 'Roman Polanski', 8.5, 'Adrien Brody as Wladyslaw Szpilman\r\nThomas Kretschmann as Captain Wilm Hosenfeld\r\nEmilia Fox as Dorota\r\nEd Stoppard as Henryk', 'In this adaptation of the autobiography \"The Pianist: The Extraordinary True Story of One Man\'s Survival in Warsaw, 1939-1945,\" Wladyslaw Szpilman, a Polish Jewish radio station pianist, sees Warsaw change gradually as World War II begins. Szpilman is forced into the Warsaw Ghetto, but is later separated from his family during Operation Reinhard. From this time until the concentration camp prisoners are released, Szpilman hides in various locations among the ruins of Warsaw.', 'Action / Biography / Drama / History / Music / War', ),
(61, 'The Prestige', 2006, 'Christopher Nolan', 8.5, 'Scarlett Johansson as Olivia Wenscombe\r\nChristian Bale as Alfred Borden\r\nHugh Jackman as Robert Angier\r\nRebecca Hall as Sarah Borden', 'In the end of the nineteenth century, in London, Robert Angier, his beloved wife Julia McCullough, and Alfred Borden are friends and assistants of a magician. When Julia accidentally dies during a performance, Robert blames Alfred for her death, and they become enemies. Both become famous and rival magicians, sabotaging the performance of the other on the stage. When Alfred performs a successful trick, Robert becomes obsessed trying to disclose the secret of his competitor with tragic consequences.', 'Action / Drama / Mystery / Sci-Fi / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(62, 'Stop Making Sense', 1984, 'Jonathan Demme', 8.5, 'Bernie Worrell as Keyboards\r\nDavid Byrne as Vocals and Guitar', 'David Byrne walks onto the stage and does a solo \"Psycho Killer.\" Jerry Harrison, Tina Weymouth and Chris Frantz join him for two more songs. The crew is busy, still setting up. Then, three more musicians and two back-up singers join the band. Everybody sings, plays, harmonizes, dances, and runs. They change instruments and clothes. Bryne appears in the Big Suit. The backdrop is often black, but sometimes it displays words, images, or children\'s drawings. The band cooks for 18 songs, the lyrics are clear, the house rocks. In this concert film, the Talking Heads hardly talk, don\'t stop, and always make sense.', 'Action / Documentary / Music', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(63, 'Whiplash', 2014, 'Damien Chazelle', 8.5, 'Melissa Benoist as Nicole\r\nMiles Teller as Andrew\r\nJ.K. Simmons as Fletcher\r\nAustin Stowell as Ryan', 'A young and talented drummer attending a prestigious music academy finds himself under the wing of the most respected professor at the school; one who does not hold back on abuse towards his students. The two form an odd relationship as the student wants to achieve greatness, and the professor pushes him.', 'Action / Drama / Music', ),
(64, 'Rear Window', 1954, 'Alfred Hitchcock', 8.5, 'Grace Kelly as Lisa Carol Fremont\r\nAlfred Hitchcock as Songwriter\'s Clock-Winder\r\nJames Stewart as L.B. \'Jeff\' Jefferies\r\nKathryn Grant as Girl at Songwriter\'s Party', 'Professional photographer L.B. \"Jeff\" Jefferies breaks his leg while getting an action shot at an auto race. Confined to his New York apartment, he spends his time looking out of the rear window observing the neighbors. He begins to suspect that a man across the courtyard may have murdered his wife. Jeff enlists the help of his high society fashion-consultant girlfriend Lisa Freemont and his visiting nurse Stella to investigate.\r\n', 'Mystery / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(65, 'Bo Burnham: what.', 2013, 'Bo Burnham', 8.5, 'Bo Burnham', 'A musical stand-up comedy show by Bo Burnham, the famous internet musician.', 'Comedy / Documentary / Music', ),
(66, 'The Intouchables', 2011, 'Olivier Nakache', 8.5, 'Omar Sy as Driss\r\nFrançois Cluzet as Philippe\r\nAudrey Fleurot as Magalie', 'In Paris, the aristocratic and intellectual Philippe is a quadriplegic millionaire who is interviewing candidates for the position of his carer, with his red-haired secretary Magalie. Out of the blue, Driss cuts the line of candidates and brings a document from the Social Security and asks Phillipe to sign it to prove that he is seeking a job position so he can receive his unemployment benefit. Philippe challenges Driss, offering him a trial period of one month to gain experience helping him. Then Driss can decide whether he would like to stay with him or not. Driss accepts the challenge and moves to the mansion, changing the boring life of Phillipe and his employees.', 'Biography / Comedy / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(67, 'Dangal', 2016, 'Nitesh Tiwari', 8.5, 'Aamir Khan', 'Biopic of Mahavir Singh Phogat, who taught wrestling to his daughters Babita Kumari and Geeta Phogat. Geeta Phogat was India\'s first female wrestler to win at the 2010 Commonwealth Games, where she won the gold medal (55 kg) while her sister Babita Kumari won the silver (51 kg).', 'Action / Biography / Drama / Sport\r\n', ),
(68, 'Apocalypse Now', 1979, 'Francis Ford Coppola', 8.5, 'Harrison Ford as Colonel Lucas\r\nCharlie Sheen as Extra\r\nMarlon Brando as Colonel Walter E. Kurtz\r\nRobert Duvall as Lieutenant Colonel Bill Kilgo', 'It is the height of the war in Vietnam, and U.S. Army Captain Willard is sent by Colonel Lucas and a General to carry out a mission that, officially, \'does not exist - nor will it ever exist\'. The mission: To seek out a mysterious Green Beret Colonel, Walter Kurtz, whose army has crossed the border into Cambodia and is conducting hit-and-run missions against the Viet Cong and NVA. The army believes Kurtz has gone completely insane and Willard\'s job is to eliminate him. Willard, sent up the Nung River on a U.S. Navy patrol boat, discovers that his target is one of the most decorated officers in the U.S. Army. His crew meets up with surfer-type Lt-Colonel Kilgore, head of a U.S Army helicopter cavalry group which eliminates a Viet Cong outpost to provide an entry point into the Nung River. After some hair-raising encounters, in which some of his crew are killed, Willard, Lance and Chef reach Colonel Kurtz\'s outpost, beyond the Do Lung Bridge. Now, after becoming prisoners of Kurtz, will...\r\n\r\n', 'Drama / War', ),
(69, 'Grave of the Fireflies', 1988, 'Isao Takahata', 8.5, 'Crispin Freeman as Doctors / Old Man', 'The story of Seita and Satsuko, two young Japanese siblings, living in the declining days of World War II. When an American firebombing separates the two children from their parents, the two siblings must rely completely on one another while they struggle to fight for their survival.', 'Animation / Drama / War', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(70, 'Cinema Paradiso', 1988, 'Giuseppe Tornatore', 8.5, 'John Wayne as Ringo Kid\r\nCary Grant as Walter Burns\r\nClark Gable as Ace Wilfong\r\nCharles Chaplin as Referee / The Lone Prospector', 'A boy who grew up in a native Sicilian Village returns home as a famous director after receiving news about the death of an old friend. Told in a flashback, Salvatore reminiscences about his childhood and his relationship with Alfredo, a projectionist at Cinema Paradiso. Under the fatherly influence of Alfredo, Salvatore fell in love with film making, with the duo spending many hours discussing about films and Alfredo painstakingly teaching Salvatore the skills that became a stepping stone for the young boy into the world of film making. The film brings the audience through the changes in cinema and the dying trade of traditional film making, editing and screening. It also explores a young boy\'s dream of leaving his little town to foray into the world outside.', 'Drama', ),
(71, 'Avengers: Infinity War', 2018, 'Anthony Russo', 8.5, 'Scarlett Johansson as Natasha Romanoff / Black Widow\r\nChris Hemsworth as Thor\r\nChris Pratt as Peter Quill / Star-Lord\r\nTom Holland as Peter Parker / Spider-Man', 'As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment, the fate of Earth and existence has never been more uncertain.', 'Action / Adventure / Drama / Fantasy / Sci-Fi', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(72, 'Journey to the Edge of the Universe', 2008, 'Yavar Abbas', 8.5, 'Alec Baldwin as Narrator\r\nSean Pertwee as Narrator', 'A journey through space and time.', 'Documentary / Family', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(73, 'Spider-Man: Into the Spider-Verse', 2018, 'Bob Persichetti', 8.5, 'Hailee Steinfeld as Gwen Stacy\r\nLake Bell as Vanessa Fisk\r\nNicolas Cage as Spider-Man Noir\r\nOscar Isaac as Interesting Person #1', 'Miles Morales is a New York teen struggling with school, friends and, on top of that, being the new Spider-Man. When he comes across Peter Parker, the erstwhile saviour of New York, in the multiverse, Miles must train to become the new protector of his city.', 'Action / Adventure / Animation / Family / Sci-Fi', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(74, 'Samsara', 2011, 'Ron Fricke', 8.5, '\r\n\r\n', 'Filmed over nearly five years in twenty-five countries on five continents, and shot on seventy-millimetre film, Samsara transports us to the varied worlds of sacred grounds, disaster zones, industrial complexes, and natural wonders.', 'Documentary / Music', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(75, 'Capernaum', 2018, 'Nadine Labaki', 8.5, '\r\n\r\n', 'Capernaüm (\"Chaos\") tells the story of Zain (Zain al-Rafeea), a Lebanese boy who sues his parents for the \"crime\" of giving him life. The film follows Zain as he journeys from gutsy, streetwise child to hardened 12-year-old \"adult\" fleeing his negligent parents, surviving through his wits on the streets, where he meets Ethiopian migrant worker Rahil, who provides him with shelter and food, as Zein takes care of her baby son Yonas in return. Zein later gets jailed for committing a violent crime, and finally seeks justice in a courtroom.', 'Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(76, 'Aliens', 1986, 'James Cameron', 8.4, 'Michael Biehn as Cpl. Dwayne Hicks\r\nSigourney Weaver as Ellen Ripley\r\nill Paxton as Pvt. Hudson\r\nJames Remar as Hicks\r\n\r\n', '57 years after Ellen Ripley had a close encounter with the reptilian alien creature from the first movie, she is called back, this time, to help a group of highly trained colonial marines fight off against the sinister extraterrestrials. But this time, the aliens have taken over a space colony on the moon LV-426. When the colonial marines are called upon to search the deserted space colony, they later find out that they are up against more than what they bargained for. Using specially modified machine guns and enough firepower, it\'s either fight or die as the space marines battle against the aliens. As the Marines do their best to defend themselves, Ripley must attempt to protect a young girl who is the sole survivor of the decimated space colony.', 'Action / Adventure / Horror / Sci-Fi / Thriller', ),
(77, 'American Beauty', 1999, 'Sam Mendes', 8.4, 'Wes Bentley as Ricky Fitts\r\nMena Suvari as Angela Hayes\r\nThora Birch as Jane Burnham\r\nKevin Spacey as Lester Burnham', 'After his death sometime in his forty-third year, suburbanite Lester Burnham tells of the last few weeks of his life, during which he had no idea of his imminent passing. He is a husband to real estate agent Carolyn Burnham and father to high school student Janie Burnham. Although Lester and Carolyn once loved each other, they now merely tolerate each other. Typical wallflower Janie too hates both her parents, the three who suffer individually in silence in their home life. Janie tries to steer clear of both her parents. Carolyn, relatively new to the real estate business, wants to create the persona of success to further her career, she aspiring to the professional life of Buddy Kane, the king of the real estate business in their neighborhood. Lester merely walks mindlessly through life, including at his job in advertising. His company is downsizing, and he, like all the other employees, has to justify his position to the newly hired efficiency expert to keep his job. Things change ...\r\n\r\n', 'Action / Drama / Romance', ),
(78, 'Braveheart', 1995, 'Mel Gibson', 8.4, 'Mel Gibson as William Wallace\r\nTommy Flanagan as Morrison\r\nSophie Marceau as Princess Isabelle\r\nBrendan Gleeson as Hamish\r\n', 'William Wallace is a Scottish rebel who leads an uprising against the cruel English ruler Edward the Longshanks, who wishes to inherit the crown of Scotland for himself. When he was a young boy, William Wallace\'s father and brother, along with many others, lost their lives trying to free Scotland. Once he loses another of his loved ones, William Wallace begins his long quest to make Scotland free once and for all, along with the assistance of Robert the Bruce.', 'Action / Biography / Drama / History / War', ),
(79, 'Django Unchained', 2012, 'Quentin Tarantino', 8.4, 'Leonardo DiCaprio as Calvin Candie\r\nQuentin Tarantino as The LeQuint Dickey Mining Co. Employee / Robert\r\nChristoph Waltz as Dr. King Schultz\r\nSamuel L. Jackson as Stephen\r\n\r\n', 'In 1858, a bounty hunter named Schultz seeks out a slave named Django and buys him because he needs him to find some men he is looking for. After finding them, Django wants to find his wife, Broomhilda, who along with him were sold separately by his former owner for trying to escape. Schultz offers to help him if he chooses to stay with him and be his partner. Eventually they learn that she was sold to a plantation in Mississippi. Knowing they can\'t just go in and say they want her, they come up with a plan so that the owner will welcome them into his home and they can find a way.', 'Action / Drama / Western', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(80, 'Batman: The Dark Knight Returns, Part 2', 2013, 'Jay Oliva', 8.4, 'Ariel Winter as Robin / Carrie Kelley\r\nPaget Brewster as Lana Lang\r\nMichael Emerson as Joker\r\nPeter Weller as Batman / Bruce Wayne\r\n\r\n', 'After a 10 year absence, the Dark Knight has returned to Gotham to fight the Mutant threat. After defeating the mutants, he has taken control of a gang loyal to him in order to make Gotham a safer place. But, the Joker has decided to stop this, and fights against Batman in a deadly duel. Meanwhile, the Man of Steel is ordered to stop the Dark Knight because the government believes that his ways are wrong. As Batman fights the Joker, the Man of Steel prepares for his greatest fight.', 'Action / Adventure / Animation / Crime / Drama / Horror / Sci-Fi / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(81, 'Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb', 1964, 'Stanley Kubrick', 8.4, 'James Earl Jones as Lt. Lothar Zogg\r\nPeter Sellers as Group Capt. Lionel Mandrake / President Merkin Muffley / Dr. Strangelove\r\nKeenan Wynn as Col. \'Bat\' Guano\r\nGeorge C. Scott as Gen. \'Buck\' Turgidson', 'Paranoid Brigadier General Jack D. Ripper of Burpelson Air Force Base, believing that fluoridation of the American water supply is a Soviet plot to poison the U.S. populace, is able to deploy through a back door mechanism a nuclear attack on the Soviet Union without the knowledge of his superiors, including the Chair of the Joint Chiefs of Staff, General Buck Turgidson, and President Merkin Muffley. Only Ripper knows the code to recall the B-52 bombers and he has shut down communication in and out of Burpelson as a measure to protect this attack. Ripper\'s executive officer, RAF Group Captain Lionel Mandrake (on exchange from Britain), who is being held at Burpelson by Ripper, believes he knows the recall codes if he can only get a message to the outside world. Meanwhile at the Pentagon War Room, key persons including Muffley, Turgidson and nuclear scientist and adviser, a former Nazi named Dr. Strangelove, are discussing measures to stop the attack or mitigate its blow-up into an all ...', 'Action / Comedy / War', ),
(82, 'Once Upon a Time in America', 1984, 'Sergio Leone', 8.4, 'Jennifer Connelly as Young Deborah\r\nRobert De Niro as David \'Noodles\' Aaronson\r\nJoe Pesci as Frankie Manoldi\r\nElizabeth McGovern as Deborah Gelly', 'Epic tale of a group of Jewish gangsters in New York, from childhood, through their glory years during prohibition, and their meeting again 35 years later.', 'Action / Crime / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(83, 'Paths of Glory', 1957, 'Stanley Kubrick', 8.4, 'Kirk Douglas as Col. Dax\r\nRalph Meeker as Cpl. Philippe Paris\r\nRichard Anderson as Maj. Saint-Auban\r\nJoe Turkel as Pvt. Pierre Arnaud', 'The futility and irony of the war in the trenches in WWI is shown as a unit commander in the French army must deal with the mutiny of his men and a glory-seeking general after part of his force falls back under fire in an impossible attack.', 'Action / Drama / War', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(84, 'Princess Mononoke', 1997, 'Hayao Miyazaki', 8.4, 'Claire Danes as San\r\nGillian Anderson as Moro\r\nBilly Bob Thornton as Jigo\r\nJada Pinkett Smith as Toki', 'While protecting his village from rampaging boar-god/demon, a confident young warrior, Ashitaka, is stricken by a deadly curse. To save his life, he must journey to the forests of the west. Once there, he\'s embroiled in a fierce campaign that humans were waging on the forest. The ambitious Lady Eboshi and her loyal clan use their guns against the gods of the forest and a brave young woman, Princess Mononoke, who was raised by a wolf-god. Ashitaka sees the good in both sides and tries to stem the flood of blood. This is met by animosity by both sides as they each see him as supporting the enemy.', 'Action / Adventure / Animation / Fantasy', ),
(85, 'The Dark Knight Rises', 2012, 'Christopher Nolan', 8.4, 'Tom Hardy as Bane\r\nJoseph Gordon-Levitt as Blake\r\nChristian Bale as Bruce Wayne\r\nAnne Hathaway as Selina\r\n', 'Despite his tarnished reputation after the events of The Dark Knight (2008), in which he took the rap for Dent\'s crimes, Batman feels compelled to intervene to assist the city and its Police force, which is struggling to cope with Bane\'s plans to destroy the city.', 'Action / Adventure / Drama / Sci-Fi / Thriller', ),
(86, 'The Shining', 1980, 'Stanley Kubrick', 8.4, 'Jack Nicholson as Jack Torrance\r\nShelley Duvall as Wendy Torrance\r\nTony Burton as Larry Durkin\r\nDanny Lloyd as Danny Torrance\r\n\r\n', 'Signing a contract, Jack Torrance, a normal writer and former teacher agrees to take care of a hotel which has a long, violent past that puts everyone in the hotel in a nervous situation. While Jack slowly gets more violent and angry of his life, his son, Danny, tries to use a special talent, the \"Shining\", to inform the people outside about whatever that is going on in the hotel.', 'Action / Drama / Horror', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(87, 'Das Boot', 1981, 'Wolfgang Petersen', 8.4, 'Jürgen Prochnow as Capt.-Lt. Henrich Lehmann-Willenbrock - Der Alte', 'It is 1942 and the German submarine fleet is heavily engaged in the so-called \"Battle of the Atlantic\" to harass and destroy British shipping. With better escorts of the destroyer class, however, German U-boats have begun to take heavy losses. \"Das Boot\" is the story of the crew of one such U-Boat, with the film examining how these submariners maintained their professionalism as soldiers and attempted to accomplish impossible missions, all the while attempting to understand and obey the ideology of the government under which they served.', 'Adventure / Drama / Thriller / War', ),
(88, 'WALL·E', 2008, 'Andrew Stanton', 8.4, 'Sigourney Weaver as Ship\'s Computer\r\nJohn Ratzenberger as John\r\nKathy Najimy as Mary\r\nPete Docter as Lifeguard Bot\r\n', 'In a distant, but not so unrealistic, future where mankind has abandoned earth because it has become covered with trash from products sold by the powerful multi-national Buy N Large corporation, WALL-E, a garbage collecting robot has been left to clean up the mess. Mesmerized with trinkets of Earth\'s history and show tunes, WALL-E is alone on Earth except for a sprightly pet cockroach. One day, EVE, a sleek (and dangerous) reconnaissance robot, is sent to Earth to find proof that life is once again sustainable. WALL-E falls in love with EVE. WALL-E rescues EVE from a dust storm and shows her a living plant he found amongst the rubble. Consistent with her \"directive\", EVE takes the plant and automatically enters a deactivated state except for a blinking green beacon. WALL-E, doesn\'t understand what has happened to his new friend, but, true to his love, he protects her from wind, rain, and lightning, even as she is unresponsive. One day a massive ship comes to reclaim EVE, but WALL-E, ...', 'Action / Adventure / Animation / Family / Sci-Fi', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(89, 'How the Grinch Stole Christmas!', 1966, 'Chuck Jones', 8.4, 'Boris Karloff as Narrator / The Grinch\r\nJune Foray as Cindy Lou Who\r\nThurl Ravenscroft as Singer \'You\'re a Mean One, Mr. Grinch\'\r\nDal McKennon as Max', 'Bitter and hateful, the Grinch is irritated at the thought of the nearby village having a happy time celebrating Christmas. So disguised as Santa Claus, with his dog made to look like a reindeer, he raids the village to steal all the Christmas things. The village is sure to have a sad Christmas this year.', 'Animation / Comedy / Family / Fantasy / Musical', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(90, 'Coco', 2017, 'Lee Unkrich', 8.4, 'Alanna Ubach as Mamá Imelda\r\nJohn Ratzenberger as Juan Ortodoncia\r\nBenjamin Bratt as Ernesto de la Cruz\r\nGael García Bernal as Héctor', 'Despite his family\'s baffling generations-old ban on music, Miguel dreams of becoming an accomplished musician like his idol, Ernesto de la Cruz. Desperate to prove his talent, Miguel finds himself in the stunning and colorful Land of the Dead following a mysterious chain of events. Along the way, he meets charming trickster Hector, and together, they set off on an extraordinary journey to unlock the real story behind Miguel\'s family history.', 'Adventure / Animation / Comedy / Family / Fantasy / Music / Mystery', ),
(91, 'Your Name.', 2016, 'Makoto Shinkai', 8.4, 'Cherami Leigh as Additional Voices\r\nStephanie Sheh as Mitsuha Miyamizu\r\nBen Diskin as Additional Voices', 'Mitsuha is the daughter of the mayor of a small mountain town. She\'s a straightforward high school girl who lives with her sister and her grandmother and has no qualms about letting it be known that she\'s uninterested in Shinto rituals or helping her father\'s electoral campaign. Instead she dreams of leaving the boring town and trying her luck in Tokyo. Taki is a high school boy in Tokyo who works part-time in an Italian restaurant and aspires to become an architect or an artist. Every night he has a strange dream where he becomes...a high school girl in a small mountain town.', 'Action / Animation / Drama / Fantasy / Romance', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(92, 'A Charlie Brown Christmas', 1965, 'Bill Melendez', 8.4, '\r\n', 'When Charlie Brown complains about the overwhelming materialism that he sees amongst everyone during the Christmas season, Lucy suggests that he become director of the school Christmas paegent. Charlie Brown accepts, but it proves to be a frustrating struggle. When an attempt to restore the proper spirit with a forlorn little fir Christmas tree fails, he needs Linus\' help to learn what the real meaning of Christmas is.', 'Animation / Comedy / Family', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(93, 'Sunset Blvd.', 1950, 'Billy Wilder', 8.4, 'Buster Keaton as Buster Keaton\r\nWilliam Holden \r\nHedda Hopper as Hedda Hopper\r\nH.B. Warner as H. B. Warner\r\n\r\n', 'In Hollywood of the 50\'s, the obscure screenplay writer Joe Gillis is not able to sell his work to the studios, is full of debts and is thinking in returning to his hometown to work in an office. While trying to escape from his creditors, he has a flat tire and parks his car in a decadent mansion in Sunset Boulevard. He meets the owner and former silent-movie star Norma Desmond, who lives alone with her butler and driver Max Von Mayerling. Norma is demented and believes she will return to the cinema industry, and is protected and isolated from the world by Max, who was her director and husband in the past and still loves her. Norma proposes Joe to move to the mansion and help her in writing a screenplay for her comeback to the cinema, and the small-time writer becomes her lover and gigolo. When Joe falls in love for the young aspirant writer Betty Schaefer, Norma becomes jealous and completely insane and her madness leads to a tragic end.', 'Drama / Film-Noir', ),
(94, 'The Lives of Others', 2006, 'Florian Henckel von Donnersmarck', 8.4, 'Sebastian Koch as Georg Dreyman\r\nMartina Gedeck \r\nUlrich Mühe as Hauptmann Gerd Wiesler\r\nUlrich Tukur as Oberstleutnant Anton Grubitz\r\n\r\n', 'Gerd Wiesler is an officer with the Stasi, the East German secret police. The film begins in 1984 when Wiesler attends a play', 'Drama / Thriller', ),
(95, 'Witness for the Prosecution', 1957, 'Billy Wilder', 8.4, 'Tyrone Power \r\nMarlene Dietrich as Christine\r\nBill Erwin as Juror\r\nCharles Laughton as Sir Wilfrid Roberts\r\n', 'It\'s Britain, 1953. Upon his return to work following a heart attack, irrepressible barrister Sir Wilfrid Robarts, known as a barrister for the hopeless, takes on a murder case, much to the exasperation of his medical team, led by his overly regulated private nurse, Miss Plimsoll, who tries her hardest to ensure that he not return to his hard living ways - including excessive cigar smoking and drinking - while he takes his medication and gets his much needed rest. That case is defending American war veteran Leonard Vole, a poor, out of work, struggling inventor who is accused of murdering his fifty-six year old lonely and wealthy widowed acquaintance, Emily French. The initial evidence is circumstantial but points to Leonard as the murderer. Despite being happily married to East German former beer hall performer Christine Vole, he fostered that friendship with Mrs. French in the hopes that she would finance one of his many inventions to the tune of a few hundred pounds. It thus does ...', 'Crime / Drama / Mystery / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(96, 'Oldboy', 2003, 'Chan-wook Park', 8.4, 'Kari Wahlgren as Hypnotist\r\nMin-sik Choi \r\nCrispin Freeman as Woo-jin Lee\r\nSherry Lynn as Mi-do\r\n\r\n', 'Abducted on a rainy night in 1988, the obnoxious drunk, Oh Dae-Su, much to his surprise, wakes up locked in a windowless and dilapidated hotel room, for an unknown reason. There, his invisible and pitiless captors will feed him, clothe him and sedate him to avoid committing suicide, and as his only companion and a window to the world is the TV in his stark cell, the only thing that helps Oh Dae-Su keep going is his daily journal. But then, unexpectedly, after fifteen long years in captivity, the perplexed prisoner is deliberately released, encouraged to track down his tormentor to finally get his retribution. Nevertheless, who would hate Oh Dae-Su so much he would deny him of a quick and clean death?', 'Action / Drama / Mystery / Thriller', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(97, 'Like Stars on Earth', 2007, 'Aamir Khan', 8.4, 'Aamir Khan\r\n\r\n', 'Ishaan Awasthi is an eight-year-old child whose world is filled with wonders that no one else seems to appreciate; colours, fish, dogs and kites are just not important in the world of adults, who are much more interested in things like homework, marks and neatness. And Ishaan just cannot seem to get anything right in class. When he gets into far more trouble than his parents can handle, he is packed off to a boarding school to \'be disciplined\'. Things are no different at his new school, and Ishaan has to contend with the added trauma of separation from his family. One day a new art teacher bursts onto the scene, Ram Shankar Nikumbh, who infects the students with joy and optimism. He breaks all the rules of \'how things are done\' by asking them to think, dream and imagine, and all the children respond with enthusiasm, all except Ishaan. Nikumbh soon realizes that Ishaan is very unhappy, and he sets out to discover why. With time, patience and care, he ultimately helps Ishaan find ...', 'Drama / Family', ),
(98, '3 Idiots', 2009, 'Rajkumar Hirani', 8.4, 'Aamir Khan\r\nR Madhavan \r\nSharman Joshi\r\nBoman Irani\r\nKareena Kapoor\r\n', 'Farhan Qureshi and Raju Rastogi want to re-unite with their fellow collegian, Rancho, after faking a stroke aboard an Air India plane, and excusing himself from his wife - trouser less - respectively. Enroute, they encounter another student, Chatur Ramalingam, now a successful businessman, who reminds them of a bet they had undertaken 10 years ago. The trio, while recollecting hilarious antics, including their run-ins with the Dean of Delhi\'s Imperial College of Engineering, Viru Sahastrabudhe, race to locate Rancho, at his last known address - little knowing the secret that was kept from them all this time.', 'Comedy / Drama', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(99, 'The Cove', 2009, 'Louie Psihoyos', 8.4, 'Hayden Panettiere as Herself: Whateman Foundation / Save the Whales\r\nIsabel Lucas as Herself: Whateman Foundation / Save the Whales\r\n\r\n', 'Richard O\'Barry was the man who captured and trained the dolphins for the television show Flipper (1964). O\'Barry\'s view of cetaceans in captivity changed from that experience when as the last straw he saw that one of the dolphins playing Flipper - her name being Kathy - basically committed suicide in his arms because of the stress of being in captivity. Since that time, he has become one of the leading advocates against cetaceans in captivity and for the preservation of cetaceans in the wild. O\'Barry and filmmaker \'Louie Psihoyos (I)\' go about trying to expose one of what they see as the most cruel acts against wild dolphins in the world in Taiji, Japan, where dolphins are routinely corralled, either to be sold alive to aquariums and marine parks, or slaughtered for meat. The primary secluded cove where this activity is taking place is heavily guarded. O\'Barry and Psihoyos are well known as enemies by the authorities in Taiji, the authorities who will use whatever tactic to expel the...', 'Crime / Documentary', );
INSERT INTO `imdb` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`) VALUES
(100, 'Won\'t You Be My Neighbor?', 2018, 'Morgan Neville', 8.4, 'Jim Carrey as Himself\r\nMichael Keaton as Himself\r\nJamie Foxx as Himself\r\nJohnny Carson as Himself\r\n', 'Charmingly soft-spoken and yet powerfully incisive expressing his profound ideals, Fred Rogers was a unique presence on television for generations. Through interviews of his family and colleagues, the life of this would-be pastor is explored as a man who found a more important calling to provide an oasis for children in a video sea of violent bombardment. That proved to be his landmark series, Mister Rogers\' Neighborhood (1968), a show that could gently delve into important subjects no other children\'s show would have dared for that time. In doing so, Rogers experienced a career where his sweet-tempered idealism charmed and influenced the world whether it be scores of children on TV or recalcitrant authorities in government. However, that beloved personality also hid Rogers\' deep self-doubts about himself and occasional misjudgments even as he proved a rock of understanding in times of tragedy for a world that did not always comprehend a man of such noble character.', 'Biography / Documentary', );
